    benchmarkMessageType.getDefaultInstance().getParserForType().parseFrom(
        inputStreamList.get((int) (counter % inputStreamList.size())), extensions);
    inputStreamList.get((int) (counter % inputStreamList.size())).reset();
    counter++;
  }
}

